import {
  makeStyles,
  TableHead,
  Table,
  Paper,
  TableCell,
  TableRow,
} from "@material-ui/core";
import React from "react";

const useStyles = makeStyles({
  root: {
    width: "100%",
    height: "400px",
    margin: "100px 0 0 0 ",
    backgroundColor: "red",
  },
});

export default function User() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Paper>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Nama</TableCell>
            </TableRow>{" "}
          </TableHead>
        </Table>
      </Paper>
    </div>
  );
}
